import React from "react";
import pic from "../images/IMG_2865.jpg"

const About = () => {
  return (
    <div className="h-screen py-10">
      <h1 className="text-4xl dark:text-white text-black font-bold font-merriweather text-center">
        About Myself
      </h1>
      <img src={pic} alt="Me" />

    </div>
  );
};

export default About;
